public class MouErTouPiao {


    public static void main(String[] args) {
        System.out.println(longestDupSubstring(""));
    }


    public static String longestDupSubstring(String s) {
        int length = s.length();
        int[] nums =new int[length];
        for (int i=0 ;i<length;i++){
            nums[i]=s.charAt(i)-'a';
        }

        int left=1;
        int right=s.length();
        long modulus=(long)Math.pow(2, 32);
        while (left < right){
            int i = (left+right)/2;
            int i1 = find(i, nums, s, modulus);
            if(i1==-1){
                right=i;
            }else {
                left=i+1;
            }
        }
        int start = find(left-1, nums, s, modulus);
        return start==-1?"":s.substring(start,start+left-1);
    }


    public static int find(int len,int[] nums,String s, long modulus){

        long value=0;
        int l=26;

        HashSet<Long> values = new HashSet<>();
        for (int i = 0; i < len; i++) {
            value=(value * l + nums[i]) %modulus;
        }
        values.add(value);
        long jz=1;
        for (int i = 1; i <len ; i++) {
            jz=(jz*l) % modulus;
        }

        for (int i = 1; i < s.length()-len+1; i++) {
            value= (value-nums[i-1]*jz) * l % modulus ;
            value = value + nums[i+len-1] % modulus;
            //value = (value * l - nums[i - 1] * jz % modulus + modulus) % modulus;
            //value = (value + nums[i + len - 1]) % modulus;

            if(values.contains(value)){
                return i;
            }
            values.add(value);
        }
        return -1;
    }

    public static String longestDupSubstring2(String S) {
        int n = S.length();
        // convert string to array of integers
        // to implement constant time slice
        int[] nums = new int[n];
        for (int i = 0; i < n; ++i) nums[i] = (int)S.charAt(i) - (int)'a';
        // base value for the rolling hash function
        int a = 26;
        // modulus value for the rolling hash function to avoid overflow
        long modulus = (long)Math.pow(2, 32);

        // binary search, L = repeating string length
        int left = 1, right = n;
        int L;
        while (left != right) {
            L = left + (right - left) / 2;
            if (search(L, a, modulus, n, nums) != -1) left = L + 1;
            else right = L;
        }

        int start = search(left - 1, a, modulus, n, nums);
        return start != -1 ? S.substring(start, start + left - 1) : "";
    }


    public static int search(int L, int a, long modulus, int n, int[] nums) {
        // compute the hash of string S[:L]
        long h = 0;
        for (int i = 0; i < L; ++i) h = (h * a + nums[i]) % modulus;

        // already seen hashes of strings of length L
        HashSet<Long> seen = new HashSet();
        seen.add(h);
        // const value to be used often : a**L % modulus
        long aL = 1;
        for (int i = 1; i <= L; ++i) aL = (aL * a) % modulus;

        for (int start = 1; start < n - L + 1; ++start) {
            // compute rolling hash in O(1) time
            h = (h * a - nums[start - 1] * aL % modulus + modulus) % modulus;
            h = (h + nums[start + L - 1]) % modulus;
            if (seen.contains(h)) return start;
            seen.add(h);
        }
        return -1;
    }

}
